/* ---- PALETTE ---- */

@water:#c0d8ff;
@park:#cea;
@land:#ffffff;
@school:#f8e8c8;

Map {
  background-color:@land;
}

#water,
#ocean {
  polygon-fill:@water;
  polygon-gamma:0.5; // reduces gaps between shapes
  polygon-pattern-file:url(images/water.png);
  polygon-pattern-comp-op:color-burn;
  polygon-pattern-alignment:global; // keeps it seamless
