  [type='common'],
  [type='golf_course'],
  [type='park'],
  [type='pitch'],
  [type='recreation_ground'],
  [type='village_green'] {
    polygon-fill:@park;
  }
}

#landusages[zoom>=12] {
  [type='school'],
  [type='college'],
  [type='university'] {
    polygon-fill: @school;
  }
}
